import React from 'react';
import axios from 'axios';

export default class App extends React.Component {
  state = {
    data: [],
  };
  componentDidMount() {
    axios.get('/api').then((response) => {
      this.setState({ data: response.data });
    });
  }
  render() {
    const { data } = this.state;
    return <div>{data}</div>;
  }
}
